import React, { useState } from "react";
import Logo from "../assets/SquarLogo.png";
function Header() {
  const [nav, setNav] = useState(false);

  const handleNav = () => {
    setNav(!nav);
  };

  const navItems = [
    { id: 1, text: "Home" },
    { id: 2, text: "About" },
    { id: 3, text: "Catalog" },
    { id: 4, text: "Login" },
    { id: 5, text: "Register" },
    { id: 6, text: "Profile" },
  ];
  return (
    <div className="bg-orange-100 flex justify-between items-center h-24 max-w-[1240px] mx-auto px-4 text-black">
      {/**Business Logo*/}
      <img alt="BbyCakes Logo" src={Logo} style={{ height: "200px" }} />
      {/**Desktop Nav */}
        <ul className="hidden md:flex">
          {navItems.map(item => (
            <li key={item.id} className="p-4 hover:bg-[white] rounded-xl m-2 cursor-pointer duration-300 hover:text-black">
              {item.text}
            </li>
          ))}
        </ul>
    </div>
  );
}

export default Header;
